// components/Dashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Dashboard = () => {
    const [employees, setEmployees] = useState([]);
    const [professionalDevelopment, setProfessionalDevelopment] = useState([]);

    useEffect(() => {
        const fetchEmployees = async () => {
            try {
                const response = await axios.get('/api/employees');
                setEmployees(response.data);
            } catch (error) {
                console.error('Error fetching employees:', error);
            }
        };

        const fetchProfessionalDevelopment = async () => {
            try {
                const response = await axios.get('/api/development'); // Adjust as needed
                setProfessionalDevelopment(response.data);
            } catch (error) {
                console.error('Error fetching professional development:', error);
            }
        };

        fetchEmployees();
        fetchProfessionalDevelopment();
    }, []);

    return (
        <div>
            <h1>Dashboard</h1>
            <h2>Employees</h2>
            <ul>
                {employees.map(employee => (
                    <li key={employee.identityNumber}>
                        {employee.fullName} - Points: {employee.points}
                    </li>
                ))}
            </ul>

            <h2>Professional Development</h2>
            <ul>
                {professionalDevelopment.map(qual => (
                    <li key={qual._id}>
                        {qual.qualification} ({qual.type}) - Employee ID: {qual.identityNumber}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Dashboard;
